    Service: class EnvVarPlugin {
      constructor() {
        this.rootDir = this.use('ROOT_DIR', '.');
        this.env = this.use('NODE_ENV', 'development');
        this.prefix = this.use('ROUTE_PREFIX', '');
        this.assetPath = this.use('FRAMEWORK_STATIC_ASSET_PATH', '/_static');

        assert(!this.prefix.endsWith('/'), 'ROUTE_PREFIX must not end with /');
      }
      use(key, value) {
        if (process.env[key] === void 0) {
          const stringified = JSON.stringify(value);
          const warning = `${key} wasn't set. Default: ${stringified}`;
          // TODO inject logger above
          //eslint-disable-next-line no-console
          console.warn(chalk.yellow(warning));
        }
        return process.env[key] || value;
      }
    },
  });
};

